import React, { useState } from 'react';
import './ContactsView.css';

export default function ContactsView({ contact }) {
  // Initialize Task as an empty array
  const [Task, setTask] = useState([]);

  function Taskdelit(id) {
    // Filter out the task with the given id
    const updatedTask = Task.filter((t) => t.id !== id);
    // Update the state with the filtered tasks
    setTask(updatedTask);
  }

  return (
    <div>
      {/* Use Task (array of tasks) instead of contact */}
      {Task.map((e) => (
        <p id='box' key={e.id}>
          {/* Return the JSX element */}
          your name: {e.name}
          <br />
          your age: {e.age}
          <br />
          your number: {e.number}
          <br />
          {/* Pass e.id to Taskdelit function */}
          <button id='btn' onClick={() => Taskdelit(e.id)}>delete</button>
        </p>
      ))}
    </div>
  );
}
